export class SlideConfig {
    breakpoints: {
        sm: number, md: number, lg: number, xl: number
    } = { sm: 1, md: 2, lg: 3, xl: 5 }
    showLeftRightArrow:boolean = true;
    showDots:boolean = false;
    autoPlay = false;
}
